(224, 'Eius inventore', 'eius-inventore', 'Pariatur error esse placeat qui quia et temporibus aut nam ex maxime omnis rerum molestiae id expedita molestias aut qui esse vel enim tempora aut nihil rerum molestiae porro saepe unde quaerat omnis fugiat sit qui et quam veritatis est laborum deleniti occaecati laboriosam neque et dicta cum architecto ut velit facilis sit ullam quia asperiores aut exercitationem quos quo occaecati harum commodi est nisi animi molestiae corporis quod unde at voluptatum accusantium exercitationem veniam dolor facere eum quos distinctio aspernatur facere quam libero illo non veritatis quae non quos laboriosam earum odit animi corrupti exercitationem nemo illum qui corrupti dolor fuga similique animi est a deserunt minima vero nihil nihil cum voluptas molestiae rerum voluptatum corporis omnis et hic qui ex qui quia qui pariatur sed accusamus debitis optio dolor placeat minima eligendi quaerat laborum fugit quas sint aut ut veniam et ut explicabo repellat explicabo quisquam voluptatibus sed quam similique corporis reprehenderit corrupti at provident vero dolor et ipsam nesciunt repudiandae quidem voluptatum in unde quia quia eum ab blanditiis nulla delectus facere delectus atque sed illum quo expedita libero fugit non et voluptas et rerum dolor ut ab beatae eos non non expedita libero eum eos voluptas facere minus ex reprehenderit minima ad id maiores aut est quam qui harum aut sequi iure enim.', 1, 1262, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 14),
(225, 'In praesentium', 'in-praesentium', 'Repellendus quis quis aut et voluptatem sunt blanditiis saepe et nihil quidem error deserunt aliquam id non nostrum voluptatem dolorem et hic assumenda laboriosam dolorum quia itaque molestias itaque est et repellendus ducimus recusandae et repudiandae sunt officia aut earum quam tempora iste quae repellendus ex ut quaerat corporis libero quos sit ipsa commodi ut hic ut alias pariatur debitis adipisci assumenda sed aut aut accusantium quasi ut sed dolor quas eos aut harum minima molestias quam dolor ea nobis animi aliquid velit et libero explicabo laboriosam ea et sunt autem dicta sint nulla aut ut sit sint necessitatibus asperiores atque eum rerum recusandae quaerat earum illo facilis alias id ducimus aut voluptatem excepturi possimus aut perferendis suscipit odio veniam reprehenderit iure voluptatem et voluptate omnis eligendi corrupti nostrum quod ut ea et minus sequi velit voluptatem ut aut maiores qui corporis veritatis commodi atque sunt qui est eos atque ut ratione consequuntur aut laudantium doloremque quam dignissimos et quaerat animi quia ut fugiat quae deserunt incidunt velit illo rerum ad voluptatem aut eum et natus quibusdam optio soluta quibusdam eligendi recusandae dolorem vel accusamus esse ad impedit ducimus in quidem nesciunt iste laudantium nobis exercitationem et sed quisquam similique distinctio sed delectus voluptas dolor accusantium voluptas alias non velit maiores in eaque animi ut facilis dolor atque sint perspiciatis tenetur praesentium veniam totam consequuntur quas ab excepturi ut aspernatur vitae tenetur dicta repudiandae unde nihil ut mollitia odit ducimus asperiores.', 1, 8006, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 16),
(226, 'Quia enim', 'quia-enim', 'Sed est qui necessitatibus aut aperiam molestiae maxime odio et et non in dignissimos ea cum eos animi debitis rerum ullam debitis facere officia temporibus dolor sunt illum molestias qui suscipit architecto veniam harum assumenda suscipit non ullam incidunt veritatis repudiandae quidem numquam dicta aut est et reiciendis deserunt nostrum asperiores nihil ipsa ullam quo sint vero omnis dolores sequi facilis cupiditate expedita ipsum et culpa eum aut molestiae magni eius doloribus eos et ducimus aut asperiores tempore libero tempora amet tempore ut tempore ducimus eaque sint in molestias et quaerat qui nobis repellat dolor ullam velit voluptas in maiores commodi qui in quos mollitia quo ad autem eum vel commodi sit sit voluptatum aut iure cum beatae velit commodi dolore pariatur pariatur veritatis quis mollitia minima libero repudiandae perspiciatis aut praesentium ut quibusdam non ipsa iusto sunt eius magnam consequuntur in cumque magnam omnis officiis deleniti incidunt eveniet sed vel aliquam quia blanditiis reprehenderit accusantium nam impedit sit aut molestiae nihil dolorem ipsa voluptatem aliquid aut ex praesentium optio et corporis neque dolor maxime quo molestias sit alias non quis quas neque ipsam rerum sint ex et explicabo eligendi voluptates aut expedita voluptatibus et explicabo aut ipsum aspernatur et totam aut reiciendis est distinctio voluptatem placeat nulla veritatis dolore dolore id et odit porro dolor et ea voluptas perferendis mollitia ut quas eveniet nihil sed eveniet est nihil dolor facilis minus aliquid vitae ad quia qui est eos rerum beatae nisi quia aut vel impedit aut delectus facere sit qui odit et voluptas explicabo.', 1, 8220, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 12),
(227, 'Voluptas dolorem', 'voluptas-dolorem', 'Maxime nam rem quos rerum et ut tempora nisi mollitia quod sint vel distinctio mollitia nulla similique ex vel pariatur illum sed et est dolorem optio deserunt a deserunt mollitia et voluptatem consequatur adipisci quam ut eius vitae inventore voluptatibus delectus veritatis eos aut nemo nihil reprehenderit delectus ullam necessitatibus impedit magni commodi alias sunt in totam esse qui praesentium necessitatibus odit animi dolores voluptatem voluptatibus neque voluptatem dignissimos id neque nemo quia animi sint et officia sit eos veritatis ipsa expedita omnis cumque ratione ab laborum libero culpa quos aut fuga maxime animi aliquid harum officia expedita voluptate reprehenderit unde veniam culpa ullam ex odit sequi suscipit sapiente dolorum rerum autem rerum eius quasi inventore quo porro ad inventore qui in ut occaecati consequatur animi est commodi quia nostrum porro odio sunt sit exercitationem amet occaecati assumenda consectetur veritatis et culpa debitis fugit ad eaque perferendis veritatis dolorum enim voluptatem dolor corporis omnis hic veniam nostrum culpa quo nesciunt quis eos dolore veritatis nobis consequatur quas dolores quo vitae voluptatem excepturi eius aut voluptatem quasi amet vitae repudiandae.', 1, 5314, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 14),
(228, 'Consequatur', 'consequatur', 'Culpa est atque dolor sit consequatur nemo explicabo in nisi maxime hic illum animi repellendus ut quia voluptates eum vel dolor iste maiores velit earum occaecati tenetur in esse et aut provident ea est ea et ullam illum nemo voluptate et harum quas rem vel praesentium eos excepturi labore deserunt ab nihil alias sunt ut aliquid possimus illo aut voluptatem et quisquam ut incidunt sit fugiat commodi et modi dolorem sint qui sit sit praesentium suscipit nulla optio quia aliquam tenetur voluptate dignissimos et amet maxime dicta quos ab sapiente dolor dolor in dolore exercitationem dicta amet suscipit voluptas qui ipsa id ratione excepturi provident qui nulla possimus doloribus qui non labore et reprehenderit facilis quidem voluptas et ipsam deleniti nobis ab voluptas sequi sit dolore autem molestiae modi dolor officiis repellat similique quos porro voluptas tempore harum et magnam optio corporis omnis distinctio suscipit omnis blanditiis libero quia et vel rerum facilis animi voluptas veritatis quia iste repellat est error non voluptatem autem aut iusto atque iure mollitia saepe aliquam voluptatum ut sint beatae tempora voluptate sed ab beatae veniam rerum eveniet veritatis ratione neque voluptas quos quia autem possimus sequi sit ipsa veniam dolor optio molestiae fugit at incidunt doloribus aut.', 1, 6378, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 14),
(229, 'Autem quod', 'autem-quod', 'Veritatis non voluptatum facere ex itaque incidunt nihil voluptas ea doloremque officiis voluptates odit omnis itaque laudantium quia molestiae aut aut soluta et vitae sapiente aliquam consectetur consequatur enim voluptatem non iusto qui doloribus voluptas dolor neque nostrum qui molestias rerum minus recusandae occaecati autem voluptatem cumque ab voluptas sint ut ea tempore unde beatae nam et qui qui ut deserunt molestiae alias non sit tempore velit iste autem ipsa dolorum consequatur rerum non quasi voluptatibus dolore consequatur quia dolor iusto natus vero blanditiis vel consequatur excepturi fugiat quibusdam ea eaque aut consequatur eaque eveniet in cumque non totam autem est odio nihil ad modi nihil dolor et ipsa est est asperiores facilis impedit quia doloribus qui possimus officia distinctio et aperiam tempore qui suscipit autem consequatur quidem voluptate sequi est labore voluptas doloribus aliquam voluptatem quas dolor enim repudiandae error aspernatur et accusamus eum qui nemo rerum ea autem dolores voluptatem ex blanditiis dicta alias explicabo voluptatem odit officia cum et dicta corporis consequatur nisi perferendis et et porro fugit molestiae qui nobis repellat modi enim qui ut eius hic dolores dolor autem ullam.', 1, 9389, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 23),
(230, 'Qui veritatis', 'qui-veritatis', 'Sit natus suscipit et ea amet consequatur veritatis soluta quo repellat facilis harum commodi sequi aut nobis ducimus saepe ex a omnis neque eligendi et voluptas quia aliquam et numquam beatae qui dolor nam sint magni autem repudiandae eum occaecati voluptatem voluptatum repudiandae molestiae exercitationem ipsam repudiandae quas quis iste ut voluptas dolorem et aut iste ab iure consequatur error cumque rerum adipisci quos ut iure in corrupti sed est dolores nisi odit praesentium voluptate id modi illum omnis ea dolorem quis inventore labore enim sit consequatur dolores cum sint est aliquam cum repellat nihil at expedita debitis molestiae ullam nostrum qui molestiae sunt nesciunt iure non qui a sint ipsum delectus dolorem dolores totam est modi atque fuga sed consequatur asperiores nobis similique et tempora itaque aliquam magnam suscipit eum provident porro qui aut dolorem vitae sequi consequatur omnis vel expedita unde reiciendis culpa eum placeat harum recusandae.', 1, 1035, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 9);
INSERT INTO `article` (`article_id`, `article_title`, `article_slug`, `article_text`, `article_status`, `article_view`, `article_created`, `article_updated`, `category_id`) VALUES
(231, 'Quia iure', 'quia-iure', 'Sapiente non accusantium atque repellendus vel hic aspernatur fugiat saepe quia ab id est officiis in quasi aut tempora minima repellendus reprehenderit facere voluptas itaque velit est odit quis porro vero aut voluptate similique modi consequatur architecto aut sapiente unde debitis ipsa quos non tenetur earum explicabo aut et tenetur ducimus eligendi neque harum impedit sed dolorem cumque tenetur tempore dolores qui non quod deserunt assumenda ipsam ut adipisci amet aut earum necessitatibus dolorum amet et culpa quasi accusamus quos repudiandae eveniet est explicabo distinctio laborum eveniet id corrupti ut quidem rerum accusamus velit iste velit mollitia id eveniet quae inventore aspernatur dolores unde ipsam itaque delectus quae sed et quos in dolores dolorem voluptates dolores non dignissimos ipsum molestias ipsum est omnis facilis aut dolores commodi enim iure perspiciatis atque consectetur dolorum eveniet id aut natus facere odit voluptatem ut magni libero sint cum laudantium optio amet natus dolor et eligendi quia illo sit et beatae est est illum est omnis sed quam voluptates nulla voluptas magni ipsam quas suscipit dicta possimus delectus minus velit voluptatem quos esse qui commodi magni dolorem consectetur ducimus est architecto voluptatibus sed praesentium sed veniam quas consectetur et ut officia dignissimos eaque doloremque eligendi molestiae iusto et rerum veritatis dolores.', 1, 8134, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 30),
(232, 'Sunt architecto reiciendis', 'sunt-architecto-reiciendis', 'Excepturi iusto atque provident ducimus molestiae doloribus et accusantium aut sed aut doloribus et qui et qui voluptatem nihil mollitia natus dolores quo doloremque deserunt voluptatibus explicabo in minima ut dicta quo doloribus ipsa deserunt doloribus odit velit nemo eum impedit qui et impedit eligendi et eligendi expedita quisquam totam omnis dolores qui atque error nisi labore magni ut molestias voluptatum ea nesciunt doloribus corrupti eius quasi corporis sint soluta temporibus veniam reiciendis natus assumenda error est et doloribus beatae reprehenderit itaque sit hic rem totam incidunt nostrum autem deserunt quia natus vel ea qui similique nulla necessitatibus et eligendi repudiandae beatae alias explicabo sit iusto vero reiciendis dicta aspernatur culpa eos enim enim quibusdam nihil voluptas fugiat soluta in necessitatibus perspiciatis minus et recusandae aut eveniet praesentium rem voluptas delectus quasi in ipsa doloremque.', 1, 9307, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 19),
(233, 'Voluptates', 'voluptates', 'Libero voluptas perspiciatis non ratione soluta quis dolorum totam corrupti commodi quo in rerum in omnis aut aliquam maxime omnis et vitae distinctio et enim voluptas et perspiciatis voluptas rem dolorem expedita velit omnis harum molestiae voluptatem provident sunt voluptas quibusdam et minima porro ut fugiat aut ut quas voluptate sit perferendis architecto non voluptatum aperiam temporibus enim minus qui dolorum error laborum qui libero eum perferendis est error quis perferendis velit est eum voluptate alias aut dolores voluptate id qui cum voluptates porro nesciunt adipisci eveniet exercitationem perspiciatis voluptate harum ea aut et quod sint ut asperiores et qui doloribus consequatur minima facilis mollitia cum qui sit nihil explicabo et cumque rerum nesciunt quia deserunt sit placeat recusandae eum provident est magnam eaque qui officia omnis dolorum odit dolorem quis rerum omnis excepturi debitis reprehenderit et consequatur sapiente dolor nesciunt odio aut dignissimos ut omnis aliquid enim magni voluptatem molestias qui ex consequatur molestiae voluptates sapiente adipisci sint et quo sed eveniet corporis occaecati assumenda consequatur maiores et vitae odit porro perferendis soluta ut et aut sit recusandae et nisi enim voluptates pariatur ad expedita vitae consequatur beatae consectetur hic quisquam omnis quasi consequatur a est et quo est nihil et minus accusamus neque saepe aut officiis ullam facere veniam totam sed assumenda qui ipsa ipsam tenetur cupiditate vel reiciendis alias modi tempora quis voluptatem sed vitae ut voluptas ea nulla et earum dolor nihil ut veniam asperiores quia id dolorem facilis qui et aperiam officia et voluptatem sit quos cumque et quisquam cum dolores autem ut laborum quaerat alias maiores expedita et excepturi odio accusantium ipsam expedita impedit non quibusdam id.', 1, 5003, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 3),
(234, 'Voluptatem voluptate sunt', 'voluptatem-voluptate-sunt', 'Quam rerum quia aspernatur non quis voluptatem dolor unde blanditiis voluptas quia sequi voluptas blanditiis quis aut reprehenderit provident est id omnis amet quo pariatur in qui officiis quaerat corporis voluptate facilis eos sit consequatur qui et quam distinctio optio omnis iure commodi aut dolorem officiis iste et est qui ab asperiores quo excepturi quaerat aperiam maiores sit voluptate sed minima corrupti eius nulla consectetur consectetur rerum eligendi praesentium tenetur magni aut autem quisquam molestiae odio maxime sunt praesentium animi fugiat repellat cupiditate aut minus est aut fugiat delectus reiciendis molestiae reprehenderit magnam velit et sed qui corrupti qui reiciendis laborum fugit porro quia accusantium ut ducimus deleniti nisi ut veritatis eligendi in inventore iste tempora laudantium similique sunt sunt delectus doloremque delectus consequatur enim ea facilis non exercitationem distinctio quidem reiciendis ipsa.', 1, 2641, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 9),
(235, 'Totam occaecati voluptas quasi nihil dolorem', 'totam-occaecati-voluptas-quasi-nihil-dolorem', 'Reprehenderit nostrum quia illo totam earum quos cumque voluptates esse similique cum dignissimos eos in molestiae qui eum numquam non ea aut et earum laudantium ipsam voluptatem dolores magni aut illum soluta autem debitis quisquam error reprehenderit commodi et soluta autem iure ad est dolorem ullam neque architecto consequatur molestias nisi laudantium rerum magni aut quae ut optio ad praesentium fugiat enim architecto autem recusandae ea ex accusamus error voluptas veniam tempora est consequuntur vel et perferendis est qui sint et itaque nesciunt deleniti ipsa vitae similique quia nemo soluta numquam doloremque dolorem autem voluptatem vel in consequatur consequuntur sunt quam id facere ea vero rem nisi tenetur quo est officiis rerum labore et nihil inventore qui tempore delectus aut voluptatem facilis qui ut repellat laboriosam et voluptatibus est qui a non ducimus inventore atque at provident in officiis hic qui id quis aperiam voluptatibus odit laudantium dolorum enim suscipit placeat est aliquam vel sed quasi rem numquam vitae voluptas occaecati nulla dolores et alias quia rerum ex sit dicta sunt qui ipsum voluptatem voluptatem perferendis dolor vitae aut eius est beatae est esse consequatur et aut repellat molestias fuga quasi illo rerum sed quia molestiae aut officiis totam.', 1, 9390, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 19),
(236, 'Dicta', 'dicta', 'Illo perspiciatis inventore natus optio non error dolore vel provident exercitationem voluptatem illum quaerat neque laudantium soluta voluptatem nihil voluptatem eaque et non quo rerum recusandae numquam tenetur commodi mollitia eos illo consequatur in in ut provident sint eius quaerat tempora atque occaecati tempore harum porro dolorem nisi inventore temporibus neque eius tempore voluptatem dolor cupiditate sequi ut in incidunt tempora doloremque quod velit nam corrupti ut sint vero ea necessitatibus quod quisquam quis nam quisquam et voluptatem provident ullam impedit non earum sapiente voluptatem cum soluta in architecto molestias magni alias laboriosam sit perspiciatis quia facilis maiores ullam et id et qui debitis officia numquam ut harum praesentium nihil eveniet rem sapiente eius soluta est saepe iure esse eum quam itaque maxime quos provident ut aperiam fuga quaerat sapiente harum voluptatibus ex quibusdam sint et sunt dolorum qui blanditiis ut molestiae totam quae iste ea officia temporibus odio repellat nisi incidunt recusandae iure quia quo aliquam voluptate vitae aut iste dolores maxime tempora quam eius facilis at ea numquam quia.', 1, 4303, '2022-12-29 16:55:40', '2022-12-29 16:55:40', 9),
